import React from "react";

import Drawer from "@material-ui/core/Drawer";

function SidebarDrawer(props) {
  return (
    <div>
      <Drawer open={props.drawer} onClose={props.toggle(false)}>
        hello
      </Drawer>
    </div>
  );
}

export default SidebarDrawer;
